import React from 'react';
import { Link } from 'react-router-dom';

const DoctorCard = ({ doctor }) => {
  const handleGoToAppointment = async () => {
    window.location.href = `/setappointment/${doctor.doctorId}`;
  };
  return (
    <div className="doctor-card">
      <div className="doctor-info">
        <div style={{height: "140px"}}>
          <h2 style={{lineHeight: 1, marginBottom: "10px"}}>{doctor.firstName}</h2>
          <h2 style={{lineHeight: 1, marginBottom: "10px"}}>{doctor.lastName}</h2>
          <p style={{margin: 0}}>Contact Number: {doctor.contactNumber}</p>
          <p style={{margin: 0}}>Specialization: {doctor.specialization}</p>
          <p style={{margin: 0}}>Credentials: {doctor.credentials}</p>
        </div>
        <div>
          <button style={{padding: 5, borderRadius: 0, width: "250px", alignItems: "center", marginLeft: "5%"}} onClick={handleGoToAppointment}>Set Appointment</button>
        </div>
      </div>
    </div>
  );
};

export default DoctorCard;
